import React from 'react';
import { Button, Modal } from 'react-bootstrap';
interface props {
    visible : boolean,
    closeModal : ()=>void;
}

function ModalMarket(props:props) {


    return (
        // <div style={{position:'absolute',marginTop: 10,}}>
        //     <>

                <Modal  show={props.visible} animation={true}  onHide={props.closeModal} style={styled.container}>
                    <Button variant="secondary" onClick={props.closeModal}>
                        Close
                    </Button>
                </Modal>
            // </>
        // </div>
    );
}
const  styled={
    container:{height: 500,width: 450,backgroundColor: 'whitesmoke',marginLeft: 700,marginTop:60}
}
export default ModalMarket;
